import * as PropTypes from "prop-types";
import {createContext} from "react";
import {useLocalStorage} from "./hooks/useLocalStorage";


const AuthenticationContext = createContext({token: "", setToken(){}});

function AuthenticationContextProvider({children}) {
  const [token, setToken] = useLocalStorage('token', '');
  return <AuthenticationContext.Provider value={{token, setToken}}>
    {children}
  </AuthenticationContext.Provider>
}

AuthenticationContextProvider.propTypes = {children: PropTypes.node};

function OrderContextProvider(props) {
  return null;
}

OrderContextProvider.propTypes = {children: PropTypes.node};

function App() {
  return (
    <AuthenticationContextProvider>
      <OrderContextProvider>
        <AppRouter />
      </OrderContextProvider>
    </AuthenticationContextProvider>
  );
}

export default App;
